import {React , useState}  from "react";


const Output = (props) => {
    let {value} = props
    return (
        <>
            <div>
                {
                    value.map((item,index) => {
                        return (
                            <>
                            <label>Value: </label>
                            <li> {item}</li>  
                            </>
                        )
                    })
                }
            </div>
        </>
    )

}


export default Output
